import React, {Component} from 'react';

class Test extends Component {
  constructor(props){
    super(props);

    this.state ={
      current_tab: 0,
      last_number: 1,
      tabs: [{tab_id:1},
              {tab_id:2},
                {tab_id:3},
                {tab_id:4}],
      tab_id:'',
    };
 }

 render(){
 	return(
 		<div className="resource-pane" id="resource-pane">
 		</div>

 	);
 }


}



export default Test;
